import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate, useNavigate } from "react-router-dom";
import Register from "./Register";
import Login from "./Login";
import TodoApp from "./TodoApp"; // זה הקובץ שבו מוצגות המשימות
import "./App.css";

function App() {
  return (
    <Router>
      <MainRoutes />
    </Router>
  );
}

function MainRoutes() {
  const navigate = useNavigate();

  // מה קורה אחרי הרשמה מוצלחת
  const handleRegisterSuccess = () => {
    navigate("/login");
  };

  // מה קורה אחרי התחברות מוצלחת
  const handleLoginSuccess = () => {
    navigate("/app");
  };

  return (
    <Routes>
      <Route path="/" element={<Navigate to="/login" />} />
      <Route path="/register" element={<Register onRegisterSuccess={handleRegisterSuccess} />} />
      <Route path="/login" element={<Login onLoginSuccess={handleLoginSuccess} />} />
      <Route path="/app" element={<TodoApp />} />
      <Route path="*" element={<h2 style={{ textAlign: "center", marginTop: "40px" }}>404 - הדף לא נמצא</h2>} />
    </Routes>
  );
}

export default App;
